%script

BEGIN EXECUTE IMMEDIATE 'DROP TABLE CUSTOMERS360';
EXCEPTION WHEN OTHERS THEN NULL; END;
/
CREATE TABLE CUSTOMERS360 AS 
  SELECT A.CUST_ID, A.CUST_GENDER, A.CUST_MARITAL_STATUS, A.CUST_YEAR_OF_BIRTH, 
         A.CUST_INCOME_LEVEL, A.CUST_CREDIT_LIMIT, 
         B.EDUCATION, B.AFFINITY_CARD, B.HOUSEHOLD_SIZE, B.OCCUPATION, B.YRS_RESIDENCE, B.Y_BOX_GAMES
  FROM SH.CUSTOMERS A, SH.SUPPLEMENTARY_DEMOGRAPHICS B
  WHERE A.CUST_ID = B.CUST_ID;

%script

CREATE OR REPLACE VIEW TRAIN_DATA_V AS SELECT * FROM CUSTOMERS360 SAMPLE (60) SEED (1);

CREATE OR REPLACE VIEW TEST_DATA_V AS SELECT * FROM CUSTOMERS360 MINUS SELECT * FROM TRAIN_DATA_V;

%script

BEGIN DBMS_DATA_MINING.DROP_MODEL('GLMR_SH_REGR_SAMPLE');
EXCEPTION WHEN OTHERS THEN NULL; END;
/
DECLARE
    v_setlst DBMS_DATA_MINING.SETTING_LIST;

BEGIN
    v_setlst('PREP_AUTO') := 'ON';
    v_setlst('ALGO_NAME') := 'ALGO_GENERALIZED_LINEAR_MODEL';
    v_setlst('GLMS_DIAGNOSTICS_TABLE_NAME') := 'GLMR_SH_SAMPLE_DIAG';
    v_setlst('GLMS_FTR_SELECTION') := 'GLMS_FTR_SELECTION_ENABLE';
    v_setlst('GLMS_FTR_GENERATION') := 'GLMS_FTR_GENERATION_ENABLE';


    DBMS_DATA_MINING.CREATE_MODEL2(
        'GLMR_SH_REGR_SAMPLE',
        'REGRESSION',
        'SELECT * FROM TRAIN_DATA_V',
        v_setlst,
        'CUST_ID',
        'AFFINITY_CARD');
END;

